\/%D0%A1%D1%87%D1%91%D1%82%D1%87%D0%B8%D0%BA_%D1%8D%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B9_%D1%8D%D0%BD%D0%B5%D1%80%D0%B3%D0%B8%D0%B8\" title=\"\u0421\u0447\u0451\u0442\u0447\u0438\u043a \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u044d\u043d\u0435\u0440\u0433\u0438\u0438\">\u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u0447\u0451\u0442\u0447\u0438\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893_%D0%B3%D0%BE%D0%B4\" title=\"1893 \u0433\u043e\u0434\">1893<\/a>&#160;\u2014 \u043f\u043e\u043b\u0438\u0446\u0435\u0439\u0441\u043a\u0438\u0439 \u043f\u0440\u0435\u0444\u0435\u043a\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0430<\/a> \u041b\u0443\u0438 \u041b\u0435\u043f\u0438\u043d \u0432\u0440\u0443\u0447\u0430\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B4%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u0412\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0435 \u043f\u0440\u0430\u0432\u0430\">\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0435 \u043f\u0440\u0430\u0432\u0430<\/a> \u043e\u0441\u0442\u0430\u0432\u0448\u0435\u043c\u0443\u0441\u044f \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u043c \u0434\u043b\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u0438\u0441\u0442\u0443.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a>&#160;\u2014 \u0431\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%B2%D0%BE%D1%81%D1%82%D0%BE%D0%BA%D1%81%D0%BA%D0%