/ru.wikipedia.org\/wiki\/%D0%97%D0%BD%D0%B0%D0%BA_%D0%9E%D1%82%D0%BB%D0%B8%D1%87%D0%B8%D1%8F_%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD%D0%B0_%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0417\u043d\u0430\u043a \u041e\u0442\u043b\u0438\u0447\u0438\u044f \u0412\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u043e\u0440\u0434\u0435\u043d\u0430 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u0413\u0435\u043e\u0440\u0433\u0438\u044f\">\u0413\u0435\u043e\u0440\u0433\u0438\u0435\u0432\u0441\u043a\u0438\u043c \u043a\u0440\u0435\u0441\u0442\u043e\u043c<\/a> \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u043f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043d\u0430\u0433\u0440\u0430\u0436\u0434\u0451\u043d \u0434\u043e\u043d\u0441\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" class=\"mw-redirect\" title=\"\u041a\u0430\u0437\u0430\u0447\u0435\u0441\u0442\u0432\u043e\">\u043a\u0430\u0437\u0430\u043a<\/a> \u0438\u0437 \u0445\u0443\u0442\u043e\u0440\u0430 \u041d\u0438\u0436\u043d\u0438\u0439 \u041a\u0430\u043b\u043c\u044b\u043a\u043e\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8E%D1%87%D0%BA%D0%BE%D0%B2,_%D0%9A%D0%BE%D0%B7%D1%8C%D0%BC%D0%B0_%D0%A4%D0%B8%D1%80%D1%81%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0440\u044e\u0447\u043a\u043e\u0432, \u041a\u043e\u0437\u044c\u043c\u0430 \u0424\u0438\u0440\u0441\u043e\u0432\u0438\u0447\">\u041a\u043e\u0437\u044c\u043c\u0430 \u041a\u0440\u044e\u0447\u043a\u043e\u0432<\/a>.<\/li><li>\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%B3%D0%B8%D1%8F_(%D1%80%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD)\" class=\"mw-redirect\" title=\"\u041b\u043e\u0442\u0430\u0440\u0438\u043d\u0433\u0438\u044f (\u0440\u0435\u0433\u0438\u043e\u043d)\">\u041b\u043e\u0442\u0430\u0440\u0438\u043d\u0433\u0438\u0438<\/a>. \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043f\u044b\u0442\u0430\u043b\u0438\u0441\u044c \u0432\u0442\u043e\u0440\u0433\u043d\u0443\u0442\u044c\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044e<\/a>, \u043d\u043e \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b\u0438 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0438 \u043e\u0442\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0443<\/a>.<\/li><li>\u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2\" title=\"\u041b\u044c\u0432\u043e\u0432\">\u041b\u044c\u0432\u043e\u0432\u0435<\/a> \u0441\u043e\u0437\u0434\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B0%D0%B2%D0%BD%D0%B0%D1%8F_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B0%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u0413\u043b\u0430\u0432\u043d\u0430\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u0420\u0430\u0434\u0430\">\u0413\u043b\u0430\u0432\u043d\u0430\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u0420\u0430\u0434\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0420\u043e\u0441\u0441\u0438\u0438\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0420\u043e\u043c\u0430\u043d\u043e\u0432<\/a> \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u0441\u0435\u043c\u044c\u0451\u0439 \u043e\u0442\u043f\u0440\u0430\u0432\u043b\u0435\u043d \u043d\u0430 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%B1%D0%BE%D0%BB%D1%8C%D1%81%D0%BA\" title=\"\u0422\u043e\u0431\u043e\u043b\u044c\u0441\u043a\">\u0422\u043e\u0431\u043e\u043b\u044c\u0441\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a><ul><li>\u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D1%82%D1%8E%D0%B1%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0410\u043a\u0442\u044e\u0431\u0438\u043d\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u0410\u043a\u0442\u044e\u0431\u0438\u043d\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a> \u043f\u043e \u0440\u0430\u0437\u0433\u0440\u043e\u043